column5:
Parse and save inline comments in JS source

Inline source comments (nonJSDoc comments) do not get preserved in the node by the JSCompiler. A few examples:
let /* blah */ x = 'a';
function f(/* blah */ x) {}
let { normalProp: /* blah */ normalPropTarget } = {};
let { /* blah */ shorthandProp } = {};

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=261053300

Stop requiring abstract classes to re-define abstract methods inherited from implemented interfaces.

For example;

/** @interface */
class MyInterface {
  foo() {}
}

/** @abstract @implements {MyInterface} */
class MyAbstractClass {
  // foo is no longer needed to be redeclared on abstract class.
}

class MyClass extends MyAbstractClass {
  // foo still needs to be fulfilled by the concrete subclasses.
  foo() {}
}

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=249298120

Unifies and centralizes property lookup logic.

The traversal algorithms also updated to look primary parents first.
Although the existing algorithm works ok with current rules, when we start including implemented interfaces of the abstract classes in traverse, it will start returning incorrect results.

For example;

class Parent { /** @return {string} */ foo(){} }
class Sub extends Parent {}
class IParent { /** @return {*} */ foo(){} }
/** @implements {IParent} */
class Child extends Sub {}

even the closest definition of Child.foo is IParent.foo per BFS traversal, Parent.foo is the most authoritative one and dictates the return type if the method (i.e. string).

