Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=246536007

Improves typechecking to consider instance properties of interfaces when verifying that a type correctly implements its interfaces.

Example:
```
/** @interface */
class Iface {
  constructor() {
    /** @type {!X} */
    this.x;
  }
}

/** @implements {Iface} */
class Impl {
  // Must have either instance or prototype field matching "x".
}
```

