Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=246214880

Allow calling functions whose "this type" is top or `undefined` as free functions.

Example:
```
class Foo {
  /** @this {*} */ method() { }
}
const x = Foo.method;
x(); // This is legal now.
```

