Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=222440708

Don't drop JSDoc on member functions in testSuite({...

This fixes a bug where you couldn't use function-level suppressions on
testSuite({
  /** @suppress {checkTypes} */
  f() {
   // some type error

