Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=215286181

Automated g4 rollback of changelist 212058481.

*** Reason for rollback ***

The new linter will incorrectly warn on an unqualified template parameter, e.g.

    /** @constructor @template T */ function Foo() {}
    /** @param {T} x */ Foo.prototype.bar = function(x) {};

will warn that the T in @param needs a ! or ?.

Rolling back to prevent a bad linter release.

*** Original change description ***

Extend the CheckRedundantNullabilityModifier linter pass to also check for missing nullability modifiers according to the style guide.

***

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=212075073

Warn on early variable references in different scopes in the same function

We used to warn on cases like
function f() {
  if (true) { x; }
  var x;
}
but seem to have accidentally stopped warning when we introduced ES6 block scopes.

This does still back off on references inside function scopes, to handle cases where functions definitions are hoisted to the beginning of a block but called later.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=210153436

Better handling of anonymous classes in TypedScopeCreator

TypedScopeCreator was failing to infer the type of `this` and overriden method types in cases like

  use(class extends SomeSuperClass {
    f() {}
  });

because we didn't have a qualified name representing the method `f` in scope. Instead of requiring a qualified name, this CL just uses the property name `f` and the type on the class node.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=209077032

Allow 'undefined' as a default value when natively typechecking destructuring parameters

/** @param {{x: (string|undefined}} opts */
function f({x = undefined}) {}

