Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=208893617

Forbid @type annotations on destructuring declarations

e.g.
/** @type {number} */ const [a, b] = someArr;

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=206955371

Don't warn for missing super() in a constructor with an explicit return

It's ok at runtime as long as the constructor returns an object, e.g.

class C {}
class D extends C {
  constructor() {
    return {foo: 3};
  }
}
console.log(new D()); // Object {foo: 3}

