Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=202696612

Short circuiting async functions.
Today:
async function f() {
  var x = 10;
  return x;
}

Is transpiled to:
function f() {
  return $jscomp.executeAsyncGenerator(
      function $jscomp$async$generator() {
        var x;
        return $jscomp.generator.createGenerator(
            $jscomp$async$generator,
            function($jscomp$generator$context) {
              x = 10;
              return $jscomp$generator$context.return(x);
            });
      });
};

Will be transpiled to:
function f() {
  var x;
  return $jscomp.asyncExecutePromiseGeneratorProgram(
      function ($jscomp$generator$context) {
        x = 10;
        return $jscomp$generator$context.return(x);
      });
};

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=195251809

Prepare templates for short circuiting async functions.
Today:
async function f() {
  var x = 10;
  return x;
}

Is transpiled to:
function f() {
  return $jscomp.executeAsyncGenerator(
      function $jscomp$async$generator() {
        var x;
        return $jscomp.generator.createGenerator(
            $jscomp$async$generator,
            function($jscomp$generator$context) {
              x = 10;
              return $jscomp$generator$context.return(x);
            });
      });
};

Will be transpiled to:
function f() {
  var x;
  return $jscomp.generator.asyncExecutePromiseGenerator(
      function ($jscomp$generator$context) {
        x = 10;
        return $jscomp$generator$context.return(x);
      });
};

