Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=193372804

Simplify generators with a few (< 4) "case"s and inline them directly so that:
  switch ($context.nextAddress) {
    case 1: a();
    case 2: b();
    case 3: c();
  }
is simplified to:
  if ($context.nextAddress == 1) a();
  if ($context.nextAddress != 3) b();
  c();

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=192259507

Warn for reassigning "let" declarations inferred constant

e.g.
/** @const {number} */
let x = 2;
x = 3;

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=192215482

When building symbol table, inline typedef variables that were created by Es6RewriteModule pass.

Es6RewriteModule converts following code:

/** @typedef {number} */
export MyTypedef;

to

let MyTypedef$$module$a$module_export;
module$a$module_export = {};
module$a$module_exports.MyTypedef;

This CL removes  module$a$module_exports.MyTypedef from the symbol table and changes all references that were pointing to it instead point to MyTypedef$$module$a$module_export.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=192163933

Treat yield expressions as always capable of throwing an exception

Fixes a bug where this triggered an unreachable code warning:
  function *g() {
    try {
      yield 1;
    } catch (e) {}
  }

although code like

  const generator = g();
  g.next();
  g.throw(33);

would still cause an exception in the try block.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=191510342

Typecheck returns with children in generators.

We still don't typecheck returns with no children:
/** @return {!Generator<number>} */
function *gen() {
  return;
}

but now raise an error on returns with children that don't typecheck, like this:

/** @return {!Generator<number>} */
function *gen() {
  return 'foobar';
}

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=189815295

Prepare template for short circuiting async functions.
Today:
async function gen() {
  var x = 10;
  return x;
}

Is transpiled to:
function gen() {
  function $jscomp$async$generator() {
    var x;
    return $jscomp.generator.createGenerator(
        $jscomp$async$generator,
        function($jscomp$generator$context) {
          x = 10;
          return $jscomp$generator$context.return(x);
        });
  }
  return $jscomp.executeAsyncGenerator($jscomp$async$generator());
};

Will be transpiled to:
function gen() {
  return $jscomp.asyncExecutePromiseGeneratorFunction(
    function () {
      var x;
      return $jscomp.generator.createGenerator(
          $jscomp$async$generator,
          function($jscomp$generator$context) {
            x = 10;
            return $jscomp$generator$context.return(x);
          });
  });
};

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=187626577

Don't inline properties if the object they are on is reassigned

e.g.
var obj = {foo: 3};
var foo = obj.foo;
obj = {};
alert(foo); // don't replace this with alert(obj.foo);

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=185064959

Check for reassignments like x **= ... in ConstCheck

Previously
  /** @const */ var a = 2;
  a **= 2;
would not cause a warning even with CHECK_CONSTANTS enabled.

(Looks like the compiler does correctly throw an error for "const a = 2; a **= 2;" in VariableReferenceCheck, fortunately).

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=182601705

Only run PeepholeMinimizeConditions#tryRemoveRepeatedStatements on normalized code

When the AST is not normalized, variable names are not unique. Removing seemingly "duplicate statements" from if/else blocks without uniqueness causes problems in cases like:

if (something) {
  const x = 5;
  alert(x);
} else {
  const x = 6;
  alert(x);
}

where moving "alert(x);" out of the if/else block would cause an error.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=181679512

Handle destructuring in CoalesceVariableNames#LiveRangeChecker

This fixes some bugs in CoalesceVariableNames in ES6 mode where variables in dead destructuring assignments were incorrectly being coalesced. It also changes the AST traversal in LiveRangeChecker to visit the rhs of a destructuring assignment/declaration before the lhs, since that's how it's evaluated.

For example, it stops the compiler from coalescing "a" and "b" in
  var a = 2;
  var {b} = {};
  a;

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=181542099

Test ES6 features in RescopeGlobalFunctionsTest and add arrow function handling.

Specifically, arrow functions have a lexically-scoped this, so we can safely rewrite
  const a = () => this; a();
as
  _.a = () => this; _.a();
instead of
  _.a = () => this; (0, _.a)();

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=178824571

Make J2clConstantHoisterPass optimize stub static field initializations

e.g.:

function clinit() {
  foo = true;
}
var foo;

Also optimize the case where the initialization comes before the clinit.
e.g.:

var foo;
function clinit() {
  foo = true;
}

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=175738294

Replace accesses to inherited ES6 superclass static properties with access from the superclass.

This makes collapsing static ES6 class properties safer.

e.g.
class A {}
A.foo = 5;
class B extends A {}
use(B.foo); => use(A.foo);

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=174533724

[NTI] Handle out-of-order extern definitions, to match what the old type checker does.

This is handled correctly.
ns.Foo.Bar = ...;
ns.Foo = ...;
ns = {};

If ns is not defined at all, VarCheck complains, so we don't need to handle that case.

If ns and ns.Foo.Bar are defined, but not ns.Foo, then OTI registers the type ns.Foo.Bar, and also complains about the missing property ns.Foo. This seems like a rare case, so for now NTI won't match the OTI behavior; we don't register ns.Foo.Bar. If it turns out that it's a widespread use, we can revisit.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=170918736

Make namespaces in .i.js files contain `{}`

Previously, we were translating definitions of the form
     /** @const */ var goog = goog || {};
to
     /** @const */ var goog;
in .i.js files.  Now we will instead generate
     /** @const */ var goog = {};

This makes the generated files compatible with NTI.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=165989638

Changes ClosureRewriteModule pass to rewrite names in destructuring to have module prefix.

Today following code:

const Bar = goog.require("tests.Bar");
const {doBaz} = goog.require("tests.baz");

gets rewritten to

const module$contents$tests$usage_Bar = goog.require("tests.Bar");
const {doBaz: doBaz} = goog.require("tests.baz");

doBaz becomes a global variable. So if doBaz is used in other goog.module they all will be indexed as one symbol. This messes up index.

This CL changes rewriting logic to produce following:

const module$contents$tests$usage_Bar = goog.require("tests.Bar");
const {doBaz: module$contents$usage_doBaz} = goog.require("tests.baz");
Tested:
  locally
  unit tests
  kythe tests

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=163592210

Remove unnecessary fallthrough case labels

eg.
switch('foo') {
  case 'foo':
  case 'bar':
    alert();
}

becomes

alert();

