Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=154216580

Various paths to a prototype should be equivalent

In:
function E() {
  this.name = "N";
}

E.prototype.foo = function() {
}

E.prototype from the first line should be the same symbol as E.prototype from the 5th line.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=151610871

In Es6TypedToEs6Converter, push to the overload stack when entering a statement parent and pop it when leaving

This fixes cases like:

function f() {
  function g() {}
}

function h() {
  function g() {}
}

Note that TypeScript supports overloaded functions in function bodies:

function f() {
  function g(x: string, y: number);
  function g(x: number, y: string)
  function g(x: string|number, y: string|number) {}
}

but these can't appear in d.ts files, and our parser will reject them.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=148935429

Don't check / remove a var declaration that shadows a function name

Eg.

function f() {
  var f = 1;
}

is valid.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=147794377

When transpiling for-of loops, put the declaration of the loop variable in a new body enclosing the original loop body.

This ensures that we don't generate invalid code for cases like:

for (let x of []) {
  let x = 0;
}

Also add test cases to show that Es6RewriteBlockScopedDeclaration and VariableReferenceCheck are OK with this code.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=147217885

Add FunctionTypeBuilder.INEXISTENT_PARAM to the "functionParams"
DiagnostcGroup

This allows reporting errors on code like:

/**
 * @param {number} foo
 * @param {string} bar
 */
function hello(name) {
  alert('Hello, ' + name);
}
hello('123');

Fixes #2224 on GitHub.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=143821630

Add an options.assumeAccurateNullUndefinedTypes to gate a local type-based optimization

Before, PeepholeMinimizeConditions is folding "if (x === null)" into "if (x)" if it thinks "x" can't be undefined from its type. This is not always sound. For example:

/** @type {!Object<string, string>} */
var map = {};
var x = map['foo']; // x can be undefined at runtime, but the compiler can't prove it
if (x === null) {
  // Code relying on the difference between null and undefined can break
}

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=141925759

Added FileSystemFlags @record to the File API

This prevents renaming of the `exclusive` property in ADVANCED
compilation mode.

Example code:
```javascript
window.webkitRequestFileSystem(window.TEMPORARY, 4 * 1024,
	function(/** !FileSystem */ fs) {
		fs.root.getFile('some.file', {create:true, exclusive:true},
			function() {
				console.log(arguments);
			}
		);
	}
);
```

In ADVANCED compilation mode the `{create:true, exclusive:true}` object
is compiled to `{create:!0,a:!0}`.

Spec says it should be named `Flags` but I think that's too common name
so I went MDN's way with `FileSystemFlags`.

See
https://dev.w3.org/2009/dap/file-system/file-dir-sys.html#the-flags-dictionary
See https://developer.mozilla.org/en-US/docs/Web/API/FileSystemFlags

Closes https://github.com/google/closure-compiler/pull/2078

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=135942090

Polyfill async functions.

Draft spec is here.
http://tc39.github.io/ecmascript-asyncawait/

Simple example:

async function doStuffAsynchronously() {
  // doFirstThing() and doSecondThing() return Promises,
  // but await lets us pretend they just return the results of those Promises.
  const firstResult = await doFirstThing();
  const secondResult = await doSecondThing(firstResult);
  return new StuffDoneResult(firstResult, secondResult);
}
// returns a Promise<StuffDoneResult>
doStuffAsynchronously().then(result => { ... use the result ... })

Requires --language_in=ECMASCRIPT8

Fixes https://github.com/google/closure-compiler/issues/1391

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=135129990

Fix enum type references in generated externs

When a generated extern referenced an enum type in a parameter or
record type, the primitive underlying the enum was being used instead
of the enum itself.  For example, this code:

  /** @enum {number} */
  var E = { A: 1, B: 2 };
  /**
   * @param {function(E)} takesEnum
   * @param {E} e
   */
  function f(takesEnum, e) {
    takesEnum(e);
  }

Would become this in the generated externs for the library:

  /** @enum {number} */
  var E = { A: 1, B: 2 };
  /**
   * @param {function(number)} takesEnum
   * @param {number} e
   * @return {undefined}
   */
  var f = function(takesEnum, e) {
  };

This would affect any application wanting to use the correct enum
types when referencing this library.

This change ensures that the enum name itself is used when referencing
the enum.  The primitive type under the enum is only used in the enum
declaration.

Related to #1399 on GitHub

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=133907989

Add a distinction between @const and @final.

@const means that a value cannot be overwritten, while @final means both
that and that a class cannot be subclassed.

This also means that with transpilation
    const Foo = class {}
    const Bar = class extends Foo {}
no longer causes issues.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=129259875

Support uninlining the exports of a goog.module to create fewer aliases.

If a goog.module has exports of the form `exports = name` then we can create fewer aliases by replacing the definition of `name` throughout the module with the synthesized module export name, rather than synthesizing both a module-local and an export name.
So for example, instead of transpiling:

    goog.module('a.b.c');
    class Foo {}
    exports = Foo

to:

    class module$contents$a$b$c_Foo {}
    /** @const */ var module$exports$a$b$c = module$contents$a$b$c_Foo;

we can transpile to the even simpler:

    class module$exports$a$b$c {}

The intention is to use this to deprecate/remove the inlineAliases pass.

-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=128640756

Add support for .i.js file generator to do JSDoc propagation of simple names.

This allows for typing of useful patterns like:
    class Foo {
      constructor(/** Foo */ foo) {
        /** @const */ this.foo = foo;
      }
    }
without running type-checking.
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=127451551

In RemoveBodies, generate type annotations for inferred @const definition.

e.g.
Given
    /** @const */ var x = 5;
process this to
    /** @const {number} */ var x;

Since this relies on type information, this is currently only done when
type-checking is enabled.
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=124373828

Polymer Pass: recognize this.$ inside of property value functions.

Example:

Polymer({
  properties: {
    propName: {
      value: function() {
        return this.$.idName;
      },
    },
  },
});
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=121438270

Add the correct arguments to the DragEvent extern.

Without this change it wouldn't be possible to do something like:

// evt it's an existing Event.
const newEvtInit = {
          dataTransfer: evt.dataTransfer,
          clientX: evt.clientX,
          clientY: evt.clientY,
          bubbles: false,
        };

const newEvt = new DragEvent(evt.type, newEvtInit);
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=120827401

Fix tests that intend to check that an error is thrown but don't.

Tests of a testing API often look like this:

	try {
		runATestThatShouldFail();
		fail();
	} catch (AssertionError expected) {
	}

However, the catch() block can catch not only the expected failure from runATestThatShouldFail() but also the "test did not fail when it should have" failure from fail().
